import React, { FC } from 'react';
import { Page } from './Page';
import { RouteComponentProps } from 'react-router-dom';

interface RouteParams {
  questionId: string;
}

export const QuestionPage: FC<RouteComponentProps<RouteParams>> = () => (
  <Page>Question Page</Page>
);
